import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import LForm from '../components/LForm'



const styles = {
  Center: {
    textAlign: 'center',
    justifyContent: 'center',
    alignItems: 'center',
    padding: '10px',
    display: 'inline-flex'
  },
  Frame: {
    borderStyle: 'solid',
    borderWidth: '1px',
    borderRadius: '5px',
    padding: '10px'
  }

}

export default function Login() {
  return (
    <Container>
      <Row></Row>
      <Row className="justify-content-md-center">
        <Col md="2">why</Col>
        <Col md="auto" style={styles.Frame}>          
          <LForm />
        </Col>
        <Col md="2">not work</Col>
      </Row>
    </Container>
  )
};
